import React from "react"
import "./Modal.scss"

interface TypeModalProps {
    visibleModal: boolean,
    setVisibleModal: (visibleModal: boolean) => void,
    finalyModal: boolean,
    setFinalyModal: (finalyModal: boolean) => void,
    resultCalculateWinner: string | undefined,
    
}


const Modal: React.FC <TypeModalProps> = ({visibleModal, setVisibleModal, finalyModal, setFinalyModal, resultCalculateWinner}) => {

    const newGame = () => {
        setFinalyModal(false)
        setVisibleModal(true)
    }
    return(
        <div className="container_modal">
            {visibleModal
            ? <div>
                <h1 className={visibleModal ? "new_game_visible" : "new_game_none"}>New Game</h1>
                <div className={visibleModal ? "btn_modal" : "btn_modal_none"} onClick={() => setVisibleModal(!visibleModal)}><h1>GO!</h1></div>
              </div>
            : <div></div>
            }
            {finalyModal
            ? <div className="end_game">
                <h1 className="end_game">Result:</h1>
                <h1 className="end_game">{resultCalculateWinner} - WIN</h1>
                <div className="btn_modal" onClick={() => setVisibleModal(!visibleModal)}><h1>Again?</h1></div>
              </div>
            : <div></div>
            }
        </div>
    )
}

export default Modal;
